#!/usr/bin/env python3

# This function determines the appropriate clothing size based on chest measurement in cm.
def determine_clothing_size(chest_measurement):
    # Define the size boundaries
    if chest_measurement < 80 or chest_measurement > 124:
        size = "N/A"
    elif chest_measurement <= 90:
        size = "XS"
    elif chest_measurement <= 98:
        size = "S"
    elif chest_measurement <= 104:
        size = "M"
    elif chest_measurement <= 111:
        size = "L"
    else:
        size = "XL"
    # Return the determined size
    return size
